endiente de la edad, por la población total de edad para ingresar a la de la escuela y se multiplica el resultado por 100. Este indicador tiene valores en las dimensiones de género, localidad y grado.',1,'2014-06-25 15:31:46',557,5),('Se divide el número de repetidores en un grado dado en un año escolar t +1 por el número de alumnos del mismo cohorte matriculados en el mismo grado en la escuela año anterior, t. Este indicador tiene valores en las dimensiones del sexo, localidad, sector y grado.',1,'2014-06-25 15:31:46',559,5),('Se divide el número de graduados de primaria, independientemente de su edad, por la población teóricamente graduada de primaria,  y se multiplica el resultado por 100. Este indicador tiene valores en las dimensiónes de género, localidad y sector.',1,'2014-06-25 15:31:46',561,5),('Se divide el número total de alumnos que pertenecen a un cohorte escolar que alcanzó cada grado sucesivo del nivel educativo especificado por el número de alumnos en la cohorte escolar es decir, aquellos originalmente inscrito en el primer grado de educación primaria, y se multiplica el resultado por 100. La tasa de supervivencia se calcula sobre la base del método de cohorte reconstruida, que utiliza los datos de matrícula y repetidores por dos años consecutivos. Este indicador tiene valores en las dimensiónes de género, localidad y sector.',1,'2014-06-25 15:31:46',563,5),('Se divide el número de nuevos ingresos en el primer grado del ciclo o nivel superior educativo especificado  por el número de alumnos que se inscribieron en grado final del ciclo anterior o el nivel de educación en el anterior año escolar, y se multiplica por 100. Este indicador tiene valores en las dimensiones del sexo, localidad, sector y grado.',1,'2014-06-25 15:31:46',565,5),('Se divide el número total de alumnos matriculados en el nivel especificado de la educación por el número de profesores en el mismo nivel. Este indicador tiene valores en las dimensiónes de la localidad, sector y nivel d