t', '1', '1', '2014-06-25 15:31:46'),('539', 'Data Discrepancy Report', '1', '1', '2014-06-25 15:31:46'),('541', 'Number of students (enrollment) by sex, age, locality and grade', '1', '1', '2014-06-25 15:31:46'),('542', 'Number of teachers by sex, locality and grade', '1', '1', '2014-06-25 15:31:46'),('544', 'Institutions Report', '1', '1', '2014-06-25 15:31:46'),('551', 'Divide the number of pupils (or students) enrolled who are of the official age group for a given level of education by the population for the same age group and multiply the result by 100. This indicator has dimension values of sex, locality and grade.', '1', '1', '2014-06-25 15:31:46'),('554', 'Divide the number of children of official primary school-entrance age who enter the first grade of primary education for the first time by the population of the same age, and multiply the result by 100. This indicator has dimension values of sex and locality.', '1', '1', '2014-06-25 15:31:46'),('556', 'Divide the number of pupils (or students) enrolled in a given level of education regardless of age by the population of the age group which officially corresponds to the given level of education, and multiply the result by 100. This indicator has dimension values of sex, locality and grade.', '1', '1', '2014-06-25 15:31:46'),('557', 'Divide the number of new entrants in grade 1, irrespective of age, by the population of official school-entrance age, and multiply the result by 100. This indicator has dimension values of sex, locality and grade.', '1', '1', '2014-06-25 15:31:46'),('559', 'Divide the number of repeaters in a given grade in school year t+1 by the number of pupils from the same cohort enrolled in the same grade in the previous school year t . This indicator has dimension values of sex, locality, sector and grade.', '1', '1', '2014-06-25 15:31:46'),('561', 'Divide the number of primary graduates, irrespective of age, by the population of theoretical primary graduation, and multiply the result by 100. This indicator has dimension values of sex, locality and sector.', '1', '1', '2014-06-25 15:31:46'),('563', 'Divide the total number of pupils belonging to a school-cohort who reached each successive grade of the specified level of education by the number of pupils in the school-cohort i.e. those originally enrolled in the first grade of primary education, and multiply the result by 100. The survival rate is calculated on the basis of the reconstructed cohort method, which uses data on enrolment and repeaters for two consecutive years. This indicator has dimension values of sex, locality and sector.', '1', '1', '2014-06-25 15:31:46'),('565', 'Divide the number of new entrants in the first grade of the specified higher cycle or level of education by the number of pupils who were enrolled in the final grade of the preceding cycle or level of education in the previous school year, and multiply by 100. This indicator has dimension values of sex, locality, sector and grade.', '1', '1', '2014-06-25 15:31:46'),('567', 'Divide the total number of pupils enrolled at the specified level of education by the number of teachers at the same level. This indicator has dimension values of locality, sector and level of education.', '1', '1', '2014-06-25 15:31:46'),('571', 'Divide the number of teachers of the specified level of education who have received the minimum required teacher training by the total number of teachers at the same level of education, and multiply the result by 100. This indicator has dimension values of locality, sector and level of education.', '1', '1', '2014-06-25 15:31:46'),('573', 'Divide the number of female students by the number of male students. This indicator has dimension values of sex, locality, sector and level of education.', '1', '1', '2014-06-25 15:31:46'),('575', 'Divide the number of female tertiary students enrolled in a specified ISCED level by the total number of students (male plus female) in that level in a given academic-year, and multiply the result by 100. This indicator has dimension values of locality, sector and level of education.', '1', '1', '2014-06-25 15:31:46'),('577', 'Divide the total number of female teachers at a given level of education by the total number of teachers (male and female) at the same level in a given school year, and multiply by 100. This indicator has dimension values of locality, sector and level of education.', '1', '1', '2014-06-25 15:31:46'),('579', 'Divide the number of pupils (or students) enrolled in private educational institutions in a given level of education by total enrolment (public and private) at the same level of education, and multiply the result by 100. This indicator has dimension values of sex, locality and level of education.', '1', '1', '2014-06-25 15:31:46'),('581', 'Divide the total number of pupils enrolled at the specified level of education by the number of textbooks at the same level. This indicator has dimension values of locality, and sector.', '1', '1', '2014-06-25 15:31:46'),('583', 'Number of water sources by type. This indicator has dimension values of locality, sector and condition.', '1', '1', '2014-06-25 15:31:46'),('585', 'Number of sanitation facilities by type. This indicator has dimension values of locality, sector and condition.', '1', '1', '2014-06-25 15:31:46'),('594', 'Process', '1', '1', '2014-06-25 15:31:46'),('595', 'Abort All', '1', '1', '2014-06-25 15:31:46'),('596', 'Clear All', '1', '1', '2014-06-25 15:31:46'),('597', 'Started By', '1', '1', '2014-06-25 15:31:46'),('598', 'Started Date', '1', '1', '2014-06-25 15:31:46'),('599', 'Finished Date', '1', '1', '2014-06-25 15:31:46'),('600', 'Log', '1', '1', '2014-06-25 15:31:46'),('601', 'Processing', '1', '1', '2014-06-25 15:31:46'),('602', 'Pending', '1', '1', '2014-06-25 15:31:46'),('603', 'Aborted', '1', '1', '2014-06-25 15:31:46'),('604', 'Completed', '1', '1', '2014-06-25 15:31:46'),('605', 'Export To', '1', '1', '2014-06-25 15:31:46'),('606', 'Export', '1', '1', '